from collections import defaultdict

def subarraysDivByK(nums, k):

    store = defaultdict(list)

    count = 0
    total = 0
    for i, num in enumerate(nums):
        store[total].append(i)
        total = (total + num) % k
        count += len(store[total])
    store[total].append(i)

    return count

